INSERT INTO `singers` VALUES (1,'Hoàng Tôn','Hoàng Tôn sinh ra trong gia đình nghệ thuật, mẹ là giảng viên thanh nhạc còn bố là nhạc công guitar. Năm 2013, anh tham gia The Voice, giành giải Á Quân và gây chú ý với giọng hát tốt cùng khả năng tự sáng tác cả hai ca khúc biểu diễn trong chương trình là \"Illusion\" và \"Dành Cho Em\". Sau cuộc thi, sự nghiệp ca sĩ của Hoàng Tôn gặp nhiều thuận lợi, anh có những bản hit được yêu thích như \"Em Không Quây Về\" (2014), \"Yêu Em Rất Nhiều\" (2017) hay \"Please\" (2018)... Ngoài ca sĩ solo, anh cũng là hát chính của nhóm nhạc 4 người có tên FBBoiz.',_binary 'data:image/jpeg;base64,','2021-11-26 17:07:20','2021-11-26 17:07:20'),(2,'Chi Dân','Năm 2008, Chi Dân thi vào nhạc viện TPHCM, trong thời gian đi học anh tham gia nhóm Hero. Đến năm 2012, anh tách ra hát solo với ca khúc “Mất Trí Nhớ”. Năm 2013, anh ra mắt ca khúc tự sáng tác mang tên Người Tôi Yêu. Năm 2016 anh thành công với Điều Anh Biết, năm 2017 là 1 2 3 4.',_binary 'data:image/png;base64,','2021-11-26 17:09:16','2021-11-26 17:09:16'),(3,'ERIK','ERIK tham gia Giọng Hát Việt Nhí năm 2013 và dừng lại ở vị trí top 15. Năm 2014, anh tham gia cuộc thi của St.319 Entertainment và trở thành thực tập sinh. Năm 2016, ERIK debut với ca khúc Pop ballad \"Sau Tất Cả\". Ca khúc nhanh chóng trở thành cơn sốt đối với giới trẻ. Năm 2017, ERIK rời công ty. Anh kết hợp với MIN trong ca khúc \"Ghen\". Bài hát là bước tiến nổi bật trong sự nghiệp ca hát của anh.',_binary 'data:image/png;base64,','2021-11-26 17:09:59','2021-11-26 17:09:59'),(4,'Mr. Siro','Là một nhạc sỹ có khả năng tự trình bày những ca khúc do chính anh sáng tác được khán giả đặc biệt yêu thích. Từ năm 2008, Mr. Siro sớm có được những bài HIT đầu tay như Em, Melancholy, Mây, Giấc Mơ Của Anh, I miss you từ năm cho đến gần đây (2012, 2013, 2014) Mr. Siro lập HIT liên tục với những sáng tác liên tiếp đứng đầu các bảng xếp hạng trong suốt nhiều tuần liền như Lắng Nghe Nước Mắt, Bức Tranh Từ Nước Mắt, Không Cần Thêm Một Ai Nữa (ft BigDaddy), Em Đã Sai Vì Em Tin (Bích Phương). Gần đây nhất là bài Em Gái Mưa (Hương Tràm) đang nằm trong top bảng xếp hạng của Zing MP3. Năm 2013, anh đạt nhiều giải thưởng quan trọng do Làn Sóng Xanh và Zing Music Award trao giúp con đường âm nhạc của ngày ngày một rộng mở hơn.',_binary 'data:image/png;base64,','2021-11-26 17:11:10','2021-11-26 17:11:10'),(5,'Noo Phước Thịnh','Tên đầy đủ của Noo Phước Thịnh là Nguyễn Phước Thịnh. Anh giải thích rằng do anh sinh cận ngày Noel nên ba mẹ anh lấy luôn chữ Noel làm tên gọi ở nhà. Tuy nhiên, chữ Noel hơi khó đọc đối với một số người lớn tuổi trong nhà, nên mọi người chuyển sang gọi Nô. Rồi ba mẹ anh lại thấy chữ Nô mang tính phủ định quá, nên quyết định thêm một chữ O nữa thành Noo.',_binary 'data:image/png;base64,','2021-11-26 17:12:33','2021-11-26 17:12:33'),(6,'Lou Hoàng','Lou Hoàng từng xuất hiện trong cuộc thi Ngôi sao Việt, gây ấn tượng với ngoại hình cao ráo và khả năng hát được nhiều dòng nhạc khác nhau. Năm 2016, Lou Hoàng kết hợp cùng Miu Lê ra mắt ca khúc \"Yêu Một Người Có Lẽ\", đây là bài hát do nhạc sĩ OnlyC, đồng thời cũng là thầy của anh sáng tác. Cùng năm đó, Lou Hoàng kết hợp với OnlyC trong ca khúc \"Đếm Ngày Xa Em\". Năm 2019 có thể xem là một năm thành công của Lou Hoàng khi hầu hết các ca khúc của anh đều được đón nhận nồng nhiệt, có thể kể đến \"Yêu Em Dại Khờ\", \"Cảm Giác Lúc Ấy Sẽ Ra Sao\", \"Không Sao Mà, Em Đây Rồi\" (cùng với Suni Hạ Linh) hay \"Là Bạn Không Thể Yêu\". Năm 2020, Lou Hoàng kết hợp với AMEE và Rhymastic trong \"1000x (Ngàn Lần).',_binary 'data:image/png;base64,','2021-11-26 17:14:11','2021-11-26 17:14:11'),(7,'OnlyC','Năm 2006, OnlyC cùng bạn thành lập nhóm nhạc underground Traisway Band. Cũng trong năm đó, OnlyC đi học kỹ năng phòng thu tại Singapore. Dự án đầu tiên của anh khi trở về nước là sản xuất và sáng tác cho album Try To Up của Khổng Tú Quỳnh vào năm 2009. OnlyC được các nghệ sĩ nổi tiếng đặt hàng ca khúc, có thể kể đến 365 DaBand, Miu Lê, Hồ Ngọc Hà... Không chỉ vậy, anh còn được gọi là \"Nhạc Sĩ Nhạc Phim\" khi có nhiều sáng tác như \"Hai Cô Tiên\" và \"Bống Bống Bang Bang\", \"Em Chưa 18\", Yêu Là Tha Thu\"... Không chỉ sáng tác, OnlyC còn là một ca sĩ được yêu thích với nhiều ca khúc tạo xu hướng trong giới trẻ như \"Anh Không Đòi Quà\" (với Karik), \"Quan Trọng Là Thần Thái\" (với Karik), \"Đau Để Trưởng Thành\"...',_binary 'data:image/png;base64,','2021-11-26 17:15:25','2021-11-26 17:15:25'),(8,'Hứa Kim Tuyền','- Top 5 team Giáng Son, chương trình Sing My Song mùa đầu tiên. - Là tác giả của các ca khúc như Hôm nay tôi cô đơn quá, Không ai hơn em đâu anh (Tóc Tiên), Một ngày hay trăm năm (Văn Mai Hương), Cứ yêu đi (Đức Phúc ft. Hòa Minzy), Người ta có thương mình đâu (Trúc Nhân), Muốn (Miu Lê)…',_binary 'data:image/png;base64,','2021-11-27 17:28:13','2021-11-27 17:28:13'),(9,'JSOL','Nguyễn Thái Sơn là sinh viên khoa Thanh nhạc, Đại học Văn hóa Nghệ thuật và Quân đội Hà Nội, có sự yêu thích và đam mê với ca hát từ nhỏ. Với gương mặt sáng, chất giọng tốt, Thái Sơn luôn là gương mặt được lựa chọn tham dự nhiều cuộc thi hát ở trường, lớp và địa phương.  Để thực hiện được ước mơ, Sơn đã rất vất vả khi thuyết phục bố mẹ ủng hộ con đường này của mình. Đôi khi sau những giờ học thanh nhạc, vũ đạo mệt mỏi, Sơn đôi khi cảm thấy nản chí nhưng với niềm đam mê của mình, Sơn lại tiếp tục cố gắng trên con đường mình đã chọn.',_binary 'data:image/png;base64,','2021-12-10 17:58:02','2021-12-10 17:58:02'),(10,' DatKaa','Là ca sĩ đang rất được giới trẻ, đặc biệt là gen Z yêu thích với những ca khúc như \"Dừng Thương\", \"Hạ Còn Vương Nắng\"...',_binary 'data:image/png;base64,','2021-12-10 17:59:13','2021-12-10 17:59:13'),(11,'X2X','X2X hoạt động từ năm 2018 với các thành viên JokeS Bii (rapper và là trưởng nhóm), Phát Hồ (hát chính), Sinike (sáng tác) và DinhLong (nhà sản xuất âm nhạc). Các thành viên đều là những chàng trai trẻ tuổi và đến với âm nhạc bằng đam mê. X2X bất ngờ nổi tiếng qua bản hit \"Cô Thắm Không Về\" trong năm 2019. Trước đó, X2X đã có MV đầu tiên là \"Cô Gái Miền Tây\" vào cuối năm 2018. Sau đó nhóm X2X tiếp tục cho ra mắt các sản phẩm như: \"Phụ Duyên\" (2019), \"Thiệp Hồng Người Dưng\" (2019), \"Cố Giang Tình\" (2020) và nhận được những phản ứng tích cực từ khán giả. Ngoài các sáng tác mang giai điệu hiện đại kết hợp với dân ca, X2X luôn muốn thử sức với nhiều thể loại âm nhạc như Ballad, R&B...',_binary 'data:image/png;base64,','2021-12-10 18:00:11','2021-12-10 18:00:11'),(12,'Phát Hồ','Phát Hồ là thành viên nhóm nhạc X2X hoạt động từ năm 2019.',_binary 'data:image/png;base64,','2021-12-10 18:01:06','2021-12-10 18:01:06'),(13,'JokeS Bii','dsdsdssdds',_binary 'data:image/png;base64,','2021-12-10 18:02:09','2021-12-10 18:02:09'),(14,'Da LAB','Năm 2007, Da LAB được thành lập với Võ Việt Phương, Nguyễn Trọng Đức và Trần Minh Phương, đến năm 2018 thì thêm Nguyễn Hoàng Long để tạo nên đội hình 4 thành viên như bây giờ. Thời gian đầu, Da LAB cover theo phong cách rap, hiphop từ các bản rap của Eminem, 50 Cent, G-Unit… sau đó chuyển sang sáng tác và trình bày các ca khúc của mình. Đây cũng là thời điểm Da LAB bắt đầu được biết đến, khởi đầu với bài hát \"Hà Nội Giờ Tan Tầm\" và tham gia chương trình Bài hát Việt 2013. Sự ra đời của \"Một Nhà\" năm 2015 được xem là cột mốc đánh dấu sự thành công của nhóm.',_binary 'data:image/png;base64,','2021-12-10 18:03:18','2021-12-10 18:03:18'),(15,'Quân A.P','Được giới trẻ biết đến, yêu mến và ưu ái với hàng loạt những danh xưng có cánh như “soái ca cover”, “hotboy cover”, “Sát thủ cover làm bay màu bản gốc”... Anh chàng từng gây sốt bởi gương mặt điển trai, thư sinh, dễ khiến fan nữ “đổ gục” từ cái nhìn đầu tiên với đôi mắt một mí dễ thương, nụ cười tỏa nắng đầy cuốn hút.  Đặc biệt, Quân A.P còn sở hữu màu giọng nam tính, chất trầm khàn đặc trưng, ấm áp... Đây được cho là thứ “vũ khí” để anh chàng chinh phục người yêu nhạc bởi hàng loạt những bản cover hàng chục triệu view trên mạng xã hội như “Chiều hôm ấy”, “Đừng như thói quen”, “Đừng ai nhắc về cô ấy”... Trước khi debut với sản phẩm âm nhạc đầu tay, qua những sản phẩm cover ấn tượng, Quân A.P đã có một lượng fan nhất định trên Facebook và nhiều trang mạng xã hội khác.',_binary 'data:image/png;base64,','2021-12-10 18:04:18','2021-12-10 18:04:18'),(16,'     Nguyên Jenda','aaaaaaaaaaaaaaaaa',_binary 'data:image/png;base64,','2021-12-10 18:05:05','2021-12-10 18:05:19'),(17,' Yến Tatoo','Yến Tatoo là nữ ca sĩ trẻ được đông đảo các khán giả biết đến và yêu mến sau khi cô đã gây sốt cộng đồng mạng qua những bản cover nhạc chế trên nền những ca khúc hit Với gương mặt xinh xắn, giọng hát truyền cảm và đầy nội lực cô đã nhận được khá nhiều sự quan tâm của cộng đồng mạng, trở thành một trong những hiện tượng cover được yêu thích nhất hiện nay',_binary 'data:image/png;base64,','2021-12-10 18:06:13','2021-12-10 18:06:13'),(18,'Thiều Bảo Trâm','Thiều Bảo Trâm tốt nghiệp vào trong trường Cao đẳng văn hóa nghệ thuật Hà Nội. Với giọng hát đầy nội lực cùng kỹ thuật, cô là gương mặt triển vọng từ các cuộc thi như: Giọng Hát Việt 2013, Ngôi Nhà Âm Nhạc hay Tiếng Ca Học Đường. Sau cuộc thi Giọng Hát Việt 2013, Thiều Bảo Trâm cùng chị gái là Thiều Bảo Trang thành lập nhóm nhạc có tên Bee.T do chị gái làm trưởng nhóm. Năm 2015, nhóm tan rã, cô bắt đầu sự nghiệp solo, gây ấn tượng với khán giả bằng MV debut \"Cơn Mơ Ngọt Ngào\", sau đó là \"Kệ Anh Thôi\", \"Thương Anh\" và \"Triệu Lý Do\".',_binary 'data:image/png;base64,','2021-12-10 18:07:58','2021-12-10 18:07:58'),(19,' Hương Ly','Cô nàng Nguyễn Hương Ly hiện đang sở hữu những bản cover “làm mưa làm gió” trên mạng xã hội với hàng triệu lượt nghe, cô được những người yêu mến đặt biệt danh là Ngọc Nữ cover bởi vẻ ngoài xinh đẹp, nổi bật cùng giọng hát ngọt ngào, đầy nội lực Những bản cover của Hương Ly được yêu mến bởi cách thể hiện tự nhiên, giàu cảm xúc. Sự kết hợp với nhiều nhạc cụ khác nhau cũng mang đến nhạc cảm mới lạ và bất ngờ.',_binary 'data:image/png;base64,','2021-12-10 18:10:06','2021-12-10 18:10:06'),(20,' Jombie','Là rapper và trưởng nhóm của nhóm rapper G5R, anh nổi tiếng với những bài nhạc đậm chất miền Tây như \"Đại Tây Nam\", \"Tiếng Chuông Bát Nhã\",...',_binary 'data:image/png;base64,','2021-12-10 18:11:06','2021-12-10 18:11:06'),(21,' Phạm Đình Thái Ngân','Phạm Đình Thái Ngân sinh ra trong gia đình có truyền thống âm nhạc. Anh đăng ký tham gia nhiều cuộc thi âm nhạc nhưng không đạt được thành tích cao, nổi bật nhất có thể kể đến top 7 chung cuộc của cuộc thi The X Factor vào năm 2014. Sau cuộc thi, anh chính thức con đường ca hát chuyên nghiệp bằng việc phát hành single “Rồi Từ Khi Đổi Thay”, sau đó là một số ca khúc Indie như \"Lạ\", \"Khung Cửa Sổ Khép Kín\"... Nhưng phải đến năm 2019, sau thành công với việc lồng tiếng cho phim \"Mắt Biếc\", tên tuổi của Phạm Đình Thái Ngân mới thực sự bật lên. Các ca khúc cũ của anh được mọi người tìm nghe lại.',_binary 'data:image/png;base64,','2021-12-10 18:12:44','2021-12-10 18:12:44');
